import { useState } from 'react';

import Card from './Card';
import Navigation from './Navigation';
import Quotes from './Quotes';
import Search from './Search';

import '../CSS/LandingPage.css';

function LandingPage(){
	const [selectedCountry, setSelectedCountry] = useState('');
	const [selectedCountryTwo, setSelectedCountryTwo] = useState('');
	return(
		<>
		<Navigation/>
              <Search setSelectedCountry ={setSelectedCountry} setSelectedCountryTwo ={setSelectedCountryTwo} selectedCountry={selectedCountry} selectedCountryTwo={selectedCountryTwo}/>
              <div className='Card-Holder'>
                <Card selectedCountry ={selectedCountry} selectedCountryTwo ={selectedCountryTwo}/>
				{selectedCountryTwo.length === 0? <Card selectedCountry ={selectedCountryTwo}/>:null}
				{/* {selectedCountry !== null? <Card selectedCountry ={selectedCountry} selectedCountryTwo ={selectedCountryTwo}/>:null} */}
              </div>
              <Quotes/>
		</>

	);
}
export default LandingPage;
